    public dynamic class func drawCircularSliderGradient(frame targetFrame: CGRect = CGRect(x: 0, y: 0, width: 100, height: 100), resizing: ResizingBehavior = .aspectFit, opacity: CGFloat = 0.4) {
        //// General Declarations
        let context = UIGraphicsGetCurrentContext()!
        
        //// Resize to Target Frame
        context.saveGState()
        let resizedFrame: CGRect = resizing.apply(rect: CGRect(x: 0, y: 0, width: 100, height: 100), target: targetFrame)
        context.translateBy(x: resizedFrame.minX, y: resizedFrame.minY)
        context.scaleBy(x: resizedFrame.width / 100, y: resizedFrame.height / 100)


        //// Color Declarations
        let circularSliderGradientStop = UIColor(red: 0.000, green: 0.000, blue: 0.000, alpha: 0.500)
        let circularSliderGradientStart = UIColor(red: 1.000, green: 1.000, blue: 1.000, alpha: 0.500)

        //// Gradient Declarations
        let circularSliderGradient = CGGradient(colorsSpace: nil, colors: [circularSliderGradientStart.cgColor, circularSliderGradientStart.blended(withFraction: 0.5, of: circularSliderGradientStop).cgColor, circularSliderGradientStop.cgColor] as CFArray, locations: [0, 0.5, 1])!

        //// Oval Drawing
        context.saveGState()
        context.setAlpha(opacity)

        let ovalPath = UIBezierPath(ovalIn: CGRect(x: 0, y: 0, width: 100, height: 100))
        context.saveGState()
        ovalPath.addClip()
        context.drawRadialGradient(circularSliderGradient,
            startCenter: CGPoint(x: 50, y: 50), startRadius: 0.44,
            endCenter: CGPoint(x: 50, y: 50), endRadius: 50.08,
            options: [.drawsBeforeStartLocation, .drawsAfterEndLocation])
        context.restoreGState()

        context.restoreGState()
        
        context.restoreGState()

    }

